import {
  Route,
  NavLink,
  HashRouter
} from "react-router-dom";
import InformationSelector from "./SearchByCity";
import PreferenceInput from "./SearchByPreferences";


class Main extends Component {
  render() {
    return (
        <div>
          <ul className="header">
            <li><a href="/">Home</a></li>
            <li><a href="/stuff">Stuff</a></li>
          </ul>
          <div className="content">

          </div>
        </div>
    );
  }
}

export default Main;
